-- ----------------------------
-- View structure for type_nums
-- ----------------------------
DROP VIEW IF EXISTS `type_nums`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`127.0.0.1`  VIEW `type_nums` AS -- select * from wms_other_out  where `输入日期` BETWEEN '2018-06-01' and '2018-06-01' ;

select `出库类型`,sum(`通知单数量`),sum(`出库数量`)  from wms_other_out where `输入日期` BETWEEN '2018-06-01' and '2018-06-01' GROUP BY `出库类型` ;

-- ----------------------------
-- View structure for 日锁定计划未日清
-- ----------------------------
DROP VIEW IF EXISTS `日锁定计划未日清`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `日锁定计划未日清` AS select `qmdj`.`day_lock_plan`.`品名` AS `品名`,`qmdj`.`day_lock_plan`.`上线日期` AS `上线日期`,count(`qmdj`.`day_lock_plan`.`日锁定计划号`) AS `Count(day_lock_plan.``日锁定计划号``)`,`qmdj`.`day_lock_plan`.`是否日清` AS `是否日清` from `day_lock_plan` group by `qmdj`.`day_lock_plan`.`品名`,`qmdj`.`day_lock_plan`.`上线日期` having (`qmdj`.`day_lock_plan`.`是否日清` = 'F') ;
